import { useSelector } from "react-redux";

export default function Switch() {
    const page = useSelector(state => state.nav.currentPage);

    switch (page) {
        case 'home':
            return (<></>);
        case 'history':
            return (<></>);
        case 'guide':
            return (<></>);
        case 'faq':
            return (<></>);
        case 'support':
            return (<></>);
        default:
            return (<></>);
    }
}
